import React from "react";
// import Spinner from '../layout/Spinner'

function ProfileItem({
  profile: {
    user: { _id, name, avatar },
    status,
    company,
    location,
    skills,
  },
}) {
  return (
    <div className='profile bg-light'>
      <img src={avatar} alt='' className='round-img' />
      <div className="">
        <h2>{name}</h2>
        <p>{status}</p>
      </div>
    </div>
  );
}

export default ProfileItem;
